import { addComplain as signUpApi } from "./services/user";
import { log } from "./utils/utils";
import axios from "axios";
function Complain() {
  return (
    <>
      <center>
        {/* <div style={{backgroundImage:`url(${image})`}} >  */}
        <div className="length">
          <div className="myTable">
            <div className="form-group">
              <table>
                <tr>
                  <td className="td"></td>
                  <td className="fa">Enter OrderId</td>
                  <td>
                    <input
                      type="number"
                      required
                      className="form-control"
                      // value={orderId}
